const Nav = () => {
	return (
		<header className="flex">
			<nav>
				<div class="space-y-2">
					<span class="block w-8 h-0.5 bg-gray-600"></span>
					<span class="block w-8 h-0.5 bg-gray-600"></span>
					<span class="block w-5 h-0.5 bg-gray-600"></span>
				</div>
			</nav>
		</header>
	);
};

export default Nav;
